import React from 'react';
import '../styles/Support.css'; // Link the CSS file for Support

function Support() {
  return (
    <div className="support-container">
      <h1>Welcome to the Support Page</h1>
      <p>How can we help you? Contact us for support!</p>
    </div>
  );
}

export default Support;
